import React from 'react';
import { Card, CardActions, CardContent, Typography } from '@material-ui/core';
import { Pagination } from '@material-ui/lab';
import { blue } from '@material-ui/core/colors';
import Head from 'next/head';
import { Button } from './styles';

const Quiz = () => {
  return (
    <>
      <Head>
        <link rel="stylesheet" href="/pages/quiz/styles.css" />
      </Head>
      <div style={{ backgroundColor: blue[300] }} className="background">
        <Card className={['card']}>
          <CardContent>
            <Typography className={['card-title']} gutterBottom>
              Que tipo de empreendedor é você durante a crise?
            </Typography>
            <hr />
            <p id="question"></p>
            <form id="answers" action="#"></form>
          </CardContent>
          <CardActions>
            <p id="question"></p>
            <form id="answers" action="#"></form>
          </CardActions>
          <div className={['card-footer']}>
            <hr />
            <Button variant="contained" color="blue" className={['button']}>
              Próxima Pergunta
            </Button>
            <Pagination color="primary" style={{ marginTop: 40 }} count={10} />
          </div>
        </Card>
      </div>
    </>
  );
};

export default Quiz;
